import React from 'react';
import { Container, Avatar, Typography, Grid, TextField, Button } from '@material-ui/core';
import LockOutLineIcon from '@material-ui/icons/LockOutlined'
const style = {
    paper : {
        marginTop : 8,
        display : "flex",
        flexDirection : "column",
        alignItems : "center"
    },
    avatar : {
        margin : 8,
        backgroundColor: "#e53935"
    },
    form:{
        width : "100%",
        marginTop : 10
    },
    submit:{
        marginTop : 15,
        marginBottom : 20
    }
}

class Register extends React.Component{
    render(){
        return (
            <Container maxWidth="md">
                <div style={style.paper}>
                    <Avatar style = {style.avatar}>
                        <LockOutLineIcon/>
                    </Avatar>
                    <Typography component="h1" variant="h5">
                            Registre su cuenta
                    </Typography>
                    <form style ={style.form}>
                        <Grid container spacing={2}>
                           < Grid item md={6} xs={12}>
                                <TextField name="nombre" fullWidth label = "Ingrese su nombre"></TextField>
                            </Grid>
                            < Grid item md={6} xs={12}>
                                <TextField name="apellido" fullWidth label = "Ingrese sus apellidos"></TextField>
                            </Grid>
                            < Grid item md={6} xs={12}>
                                <TextField name="email" fullWidth label = "Ingrese su email"></TextField>
                            </Grid>
                            < Grid item md={6} xs={12}>
                                <TextField type = "password" name="password" fullWidth label = "Ingrese su password"></TextField>
                            </Grid>
                        </Grid>
                        <Grid container justify = "center">
                            <Grid>
                                <Button type="submit" variant="contained" fullWidth size="large" color="primary" style={style.submit} >
                                    Registrar
                                </Button>
                            </Grid>
                        </Grid>
                    </form>
                </div>
            </Container>
          );
    }
}
export default Register;
